import React, { Component } from "react";

class IndexIntroText extends Component {
  state = {};
  render() {
    return (
      <div id="textWrapper">
        <div id="subtitle">
          Family recipe sharing made easy, for{" "}
          <span
            style={{
              fontWeight: "bold",
              fontStyle: "italic",
              fontSize: 70,
              backgroundColor: "rgb(111, 0, 255)",
              color: "white",
              padding: 2,
              borderRadius: 2,
              lineHeight: 1.3,
            }}
          >
            everyone.
          </span>
        </div>
      </div>
    );
  }
}

export default IndexIntroText;
